import { useStatem, useEffect } from 'react'
import './Counter.css'



export default function Counter (props) {

  var counterComponents = []
  for (let i = 0; i < 9; i++){
    counterComponents.push(
      <CounterComponent key={i} wrongGuesses={props.wrongGuesses}/>
    )
  }
  return (
    <div className = "counter">
      {counterComponents}
    </div>
  )
}

function CounterComponent (props) {
  console.log(props.key)
  if(props.wrongGuesses >= props.key){
    return <div className="counterComponentActive"></div>
  } else {
    return <div className="counterComponent">{props.key}</div>
  }

}
